import {BrowserRouter as Router, Switch, Route} from 'react-router-dom'

import BurgerContext from './context/burgerContext'

import Home from './pages/home'

function App() {
  return (
    <BurgerContext.Provider value="">
      <Router>
        <Switch>
          <Route exact path={"/"}>
            <Home/>
          </Route>
          <Route path={"/bucket"}>
            bucket
          </Route>
        </Switch>
      </Router>
      </BurgerContext.Provider>
  );
}

export default App;
